import React, { Component } from 'react'
import Historia from './Historia'

export default class VerHistorias extends Component {
    render() {
        return (
            <div className="card m-2 w-100 dd-flex">
                <p>Historias</p>
                <div className="row w-100">
                    <Historia/>
                    <Historia/>
                    <Historia/>
                    <Historia/>
                </div>
            </div>
        )
    }
}
